<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <title>I FETCH ROCKS - Module Browser</title>
    <style>
      body {
        background: #000;
        color: #0f0;
        font-family: "Fira Mono", "Consolas", monospace;
        font-size: 18px;
        margin: 0;
        padding: 0;
        min-height: 100vh;
        box-sizing: border-box;
        text-shadow: 0 0 1px #0f0, 0 0 4px #0f0;
      }
      .crt {
        position: fixed;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        pointer-events: none;
        z-index: 9999;
        background: repeating-linear-gradient(
          to bottom,
          rgba(0, 255, 0, 0.03) 0px,
          rgba(0, 255, 0, 0.03) 2px,
          transparent 2px,
          transparent 6px
        );
        mix-blend-mode: lighten;
      }
      h1 {
        text-align: center;
        font-size: 2.2em;
        margin: 30px 0 10px 0;
        letter-spacing: 2px;
        text-shadow: 0 0 2px #0f0, 0 0 5px #0f0;
      }
      .category {
        margin: 40px 0 0 0;
      }
      .category-title {
        font-size: 1.3em;
        margin: 0 0 10px 10px;
        border-left: 4px solid #0f0;
        padding-left: 12px;
        text-shadow: 0 0 6px #0f0;
      }
      .module-list {
        display: flex;
        flex-wrap: wrap;
        gap: 14px;
        padding: 0 10px 10px 10px;
        justify-content: flex-start;
      }
      .module {
        background: rgba(0, 32, 0, 0.7);
        border: 1.5px solid #0f0;
        border-radius: 8px;
        box-shadow: 0 0 4px #0f0 inset;
        width: 260px;
        min-height: 150px;
        display: flex;
        flex-direction: column;
        align-items: center;
        padding: 10px 6px 8px 6px;
        margin-bottom: 6px;
        transition: box-shadow 0.2s;
        cursor: pointer;
        /* Make image fill available space */
        justify-content: flex-start;
      }
      .module img {
        width: 100%;
        height: 100%;
        max-width: 220px;
        max-height: 140px;
        flex-grow: 1;
        object-fit: contain;
        margin-bottom: 6px;
        border: 1px solid #0f0;
        border-radius: 4px;
        background: #010;
        box-shadow: 0 0 4px #0f0;
      }
      .module-title {
        font-size: 1em;
        font-weight: bold;
        margin-bottom: 4px;
        text-align: center;
        text-shadow: 0 0 2px #0f0;
      }
      .module-desc {
        font-size: 0.92em;
        color: #8f8;
        text-align: center;
        margin-bottom: 6px;
        min-height: 32px;

        overflow: hidden;
      }
      .module-link {
        color: #0f0;
        text-decoration: underline;
        font-size: 0.9em;
        margin-top: auto;
        transition: color 0.2s;
      }
      .module-link:hover {
        color: #8f8;
      }
      @media (max-width: 900px) {
        .module-list {
          flex-direction: column;
          align-items: center;
        }
        .module {
          width: 95vw;
        }
      }
    </style>
  </head>

            desc: "THE MULTIPLY MODULE TAKES TWO 16-BIT VALUES, MULTIPLES THEM AND OUTPUTS THEM AS A SINGLE 16-BIT VALUE.\n\nTHE DEFAULT INTEGER MODE SIMPLY MULTIPLIES WHOLE NUMBERS TOGETHER. IF THE RESULT IS GREATER THE MAXIMUM VALUE SUPPORTED OF 65535, THE RESULT WILL WRAP AROUND FROM 0.\nE.G. 32,769 X 2 = 2\n\nIN NORMALIZED FLOAT MODE, THE INPUTS ARE NORMALIZED TO FLOATING POINT VALUES BETWEEN 0 AND 1 AND THEN MULTIPLED TOGETHER.\nE.G. 49,152 (0.75) * 13,107 (0.2) = 9,830 (0.15)",

            desc: 'THE TRIGGERED MODULE TAKES A 16-BIT INPUT, EVALUATED AGAINST "START" AND "STOP" 16-BIT VALUES.\r\n\r\nIF THE "START" SIGNAL IS LESS THAN THE "STOP" SIGNAL THE OUTPUT WILL ONLY BECOME TRUE(1) IF THE "INPUT" SIGNAL IS SMALLER THAN THE "START" SIGNAL AND THEN BECOMES LARGER THAN THE "START" SIGNAL.\r\nIF THE "INPUT" SIGNAL THEN BECOMES GREATER THAN THE "STOP" SIGNAL, THE OUTPUT BECOMES FALSE(0).\r\n\r\nIF THE "START" SIGNAL IS GREATER THAN THE "STOP" SIGNAL THE OUTPUT WILL ONLY BECOME TRUE(1) IF THE "INPUT" SIGNAL IS GREATER THAN THE "START" SIGNAL AND THEN BECOMES LESS THAN THE "START" SIGNAL.\r\nIF THE "INPUT" SIGNAL THEN BECOMES LESS THAN THE "STOP" SIGNAL, THE OUTPUT BECOMES FALSE(0).',

            desc: "THE VECTOR SIGNAL SPLITTER SPLITS THE 4 AXIS VECTOR INPUT INTO 8 SEPARATE SIGNALS.\n\nTWO SIGNALS ARE OUTPUT FOR EACH X,Y,Z,W AXIS. ONE FOR NEGATIVE VALUES AND THE OTHER FOR POSITIVE VALUES.",
            file: "VectorSplitter.html",
            category: "DATA_DISTRIBUTION",
            categoryPath: ["DATA_DISTRIBUTION", "DATA_SPLITTERS"],
          },
        ];

        // Build a nested category tree using categoryPath
        const root = { title: "", children: {}, modules: [] };
        for (const mod of modules) {
          if (!mod.categoryPath || !Array.isArray(mod.categoryPath)) continue;
          let node = root;
          for (let i = 0; i < mod.categoryPath.length; i++) {
            const part = mod.categoryPath[i];
            if (!node.children[part])
              node.children[part] = {
                title: part.replace(/_/g, " "),
                children: {},
                modules: [],
              };
            node = node.children[part];
          }
          node.modules.push(mod);
        }
        // Recursively render the tree
        function renderNode(node, depth = 0) {
          let html = "";
          if (node.title) {
            html += `<div class='category-title' style='margin-left:${
              depth * 18
            }px'>${node.title}</div>`;
          }
          if (node.modules && node.modules.length) {
            html += `<div class='module-list'>`;
            for (const mod of node.modules.sort((a, b) =>
              a.name.localeCompare(b.name)
            )) {
              html +=
                `<div class='module' style='cursor:pointer;'>` +
                (mod.imgData
                  ? `<img src="${mod.imgData}" alt="${mod.name}">`
                  : "") +
                `<div class='module-title'>${mod.name}</div>` +
                `</div>`;
            }
            html += `</div>`;
          }
          for (const key of Object.keys(node.children).sort()) {
            html += renderNode(node.children[key], depth + 1);
          }
          return html;
        }
        // Render to DOM
        const container = document.getElementById("categories");
        container.innerHTML = renderNode(root);
        // Add modal logic to all modules
        container.querySelectorAll(".module").forEach((modDiv, i) => {
          const mod = modules.find(
            (m) => m.name === modDiv.querySelector(".module-title").textContent
          );
          modDiv.onclick = (e) => {
            const modal = document.getElementById("modal");
            document.getElementById("modal-img").innerHTML = mod.imgData
              ? `<img src='${mod.imgData}' alt='' style='max-width:700px;max-height:400px;border:2px solid #0f0;border-radius:8px;background:#010;box-shadow:0 0 16px #0f0;margin-bottom:20px;'>`
              : "";
            document.getElementById("modal-title").textContent = mod.name;
            document.getElementById("modal-desc").textContent = mod.desc;
            document.getElementById("modal").style.display = "flex";
          };
        });
        // Modal close logic
        document.getElementById("modal-close").onclick = () => {
          document.getElementById("modal").style.display = "none";
        };
        document.getElementById("modal").onclick = (e) => {
          if (e.target === document.getElementById("modal")) {
            document.getElementById("modal").style.display = "none";
          }
        };
      }
      loadModulesAndRender();
    </script>
